import React from "react";
import {LogoImage, ScreenContainer, InputsContainer, SignUpButtonContainer} from "./styled";
import logo_transparante from "../../assets/logo_transparent.png";
import { Button, TextField } from "@material-ui/core";
import useForm from "../../hooks/useForm"

const LoginPage = () => {

    const [form, onChange, clear] = useForm({email:"", password:""})
    const onSubmitForm = (event) => {
        event.preventDefault()
    }

    return (
        <ScreenContainer>
          <LogoImage src={logo_transparante}/>
           <InputsContainer>
            <form onSubmit={onSubmitForm}>
                <TextField
                    name={"email"}
                    value={form.email}                    
                    onChange={onChange}  
                    label={"e-mail"}   
                    variant={"outlined"}   
                    fullWidth    
                    margin={"dense"} 
                    required
                    type={"email"}
                />
             <TextField
                    name={"password"}
                    value={form.password}                  
                    onChange={onChange} 
                    label={"Password"}   
                    variant={"outlined"}     
                    fullWidth     
                    margin={"dense"} 
                    required  
                    type={"password"}              
                />
            <Button 
               type={"submit"}
               variant={"contained"}
               fullWidth
               margin={"normal"} 
               color={"primary"}
               
               >Fazer Login
               
               </Button>
            </form>
           </InputsContainer>

                <SignUpButtonContainer>
                  

                </SignUpButtonContainer>

        </ScreenContainer>
    )
}

export default LoginPage
